// src/components/Navbar.js
import { useState } from "react";
import { 
  AppBar, 
  Toolbar, 
  Typography, 
  Button, 
  Box, 
  Container, 
  IconButton, 
  Menu, 
  MenuItem, 
  Avatar,
  useMediaQuery,
  useTheme 
} from "@mui/material";
import { Link, useNavigate } from "react-router-dom";
import { logoutUser } from "../services/api";
import MenuIcon from '@mui/icons-material/Menu';
import SearchIcon from '@mui/icons-material/Search';
import ImageIcon from '@mui/icons-material/Image';

const Navbar = ({ user, setUser }) => {
  const navigate = useNavigate();
  const theme = useTheme();
  const isMobile = useMediaQuery(theme.breakpoints.down('md'));
  const [anchorEl, setAnchorEl] = useState(null);

  const handleLogout = async () => {
    await logoutUser();
    setUser(null);
    navigate("/login");
    handleMenuClose();
  };

  const handleMenuOpen = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleMenuClose = () => {
    setAnchorEl(null);
  };

  return (
    <AppBar position="sticky" elevation={4}>
      <Container maxWidth="xl">
        <Toolbar disableGutters>
          {/* Logo and Title */}
          <Box sx={{ display: 'flex', alignItems: 'center' }}>
            <ImageIcon sx={{ mr: 1, fontSize: 32 }} />
            <Typography
              variant="h6"
              noWrap
              component={Link}
              to="/"
              sx={{
                mr: 2,
                fontWeight: 700,
                letterSpacing: '.2rem',
                color: 'inherit',
                textDecoration: 'none',
                display: { xs: 'none', sm: 'flex' }
              }}
            >
              OPEN MEDIA
            </Typography>
          </Box>

          {/* Mobile Menu */}
          {isMobile ? (
            <>
              <Box sx={{ flexGrow: 1 }} />
              <IconButton
                size="large"
                color="inherit"
                onClick={handleMenuOpen}
              >
                <MenuIcon />
              </IconButton>
              <Menu
                anchorEl={anchorEl}
                open={Boolean(anchorEl)}
                onClose={handleMenuClose}
              >
                <MenuItem onClick={() => { navigate('/'); handleMenuClose(); }}>
                  Home
                </MenuItem>
                {user ? (
                  <>
                    <MenuItem disabled>
                      Hello, {user.username}!
                    </MenuItem>
                    <MenuItem onClick={handleLogout}>
                      Logout
                    </MenuItem>
                  </>
                ) : (
                  <>
                    <MenuItem onClick={() => { navigate('/login'); handleMenuClose(); }}>
                      Login
                    </MenuItem>
                    <MenuItem onClick={() => { navigate('/register'); handleMenuClose(); }}>
                      Register
                    </MenuItem>
                  </>
                )}
              </Menu>
            </>
          ) : (
            <>
              {/* Desktop Navigation */}
              <Box sx={{ flexGrow: 1 }}>
                <Button 
                  color="inherit" 
                  component={Link} 
                  to="/"
                  startIcon={<SearchIcon />}
                  sx={{ ml: 2 }}
                >
                  Search Media
                </Button>
              </Box>
              
              {/* User Section */}
              {user ? (
                <Box sx={{ display: 'flex', alignItems: 'center' }}>
                  <Avatar sx={{ bgcolor: 'primary.main', color: 'secondary.main', width: 32, height: 32, mr: 1 }}>
                    {user.username.charAt(0).toUpperCase()}
                  </Avatar>
                  <Typography sx={{ mr: 2 }}>
                    {user.username}
                  </Typography>
                  <Button 
                    variant="outlined" 
                    onClick={handleLogout}
                    sx={{ 
                      color: 'primary.main', 
                      borderColor: 'primary.main',
                      '&:hover': { borderColor: 'primary.light', bgcolor: 'rgba(255,215,0,0.08)' }
                    }}
                  >
                    Logout
                  </Button>
                </Box>
              ) : (
                <Box>
                  <Button 
                    color="inherit"
                    component={Link} 
                    to="/login"
                    sx={{ mr: 1 }}
                  >
                    Login
                  </Button>
                  <Button 
                    variant="outlined"
                    component={Link} 
                    to="/register"
                    sx={{ 
                      color: 'primary.main', 
                      borderColor: 'primary.main',
                      '&:hover': { borderColor: 'primary.light', bgcolor: 'rgba(255,215,0,0.08)' }
                    }}
                  >
                    Register
                  </Button>
                </Box>
              )}
            </>
          )}
        </Toolbar>
      </Container>
    </AppBar>
  );
};

export default Navbar;
